void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;
    vec2 ar = vec2(iResolution.x/iResolution.y,1.0);
    vec2 p = (uv-.5)*ar;

    p *= 1.0-smoothstep(35., 37.5, iTime);    

    vec3 c = vec3(.8);

    float rnd = fract(dot(4432.1123 ,cos((fract(uv.y*975.321+uv.x*123.345)))));
    float time = iTime + rnd*.3;

    c = mix(c,vec3(1.0,1.0,1.0),.2+cos(time+tan(log(length(p)))));

    // Output to screen
    fragColor = vec4(c,1.0);
}
